def ParamSACSIMPLES(bac,cmb,num):
    """ Fun√ß√£o para consultar conjunto de par√¢metros do modelo Sacramento Simplificado, dados:
    bac [int] = n√∫mero da sub-bacia no SISPSHI;
    cmb [str] = string de cinco caracteres que representa o m√©todo de c√°lculo da CMB;
    num [int] = n√∫mero do conjunto de par√¢metros (ver ~/SISPSHI2/Parametros/anotacoes_calib.txt). """
    
    # Testando consist√™ncia dos par√¢metros de entrada
    if bac not in PARAM1:
        raise KeyError('\n     '+repr(bac)+' n√£o √© um n√∫mero de bacia v√°lido.\n')
    if cmb not in PARAM1[bac]:
        raise KeyError('\n     '+repr(cmb)+' para bacia '+repr(bac)+' n√£o √© um tipo de CMB v√°lido.\n')
    if num not in PARAM1[bac][cmb]:
        raise KeyError('\n     '+repr(num)+' em CMB='+repr(cmb)+' na bacia='+repr(bac)+' n√£o √© um n√∫mero de conjunto v√°lido.\n')

    return PARAM1[bac][cmb][num]


def ParamRRR(bac,ano,cmb=None,numero=None):
    """ Fun√ß√£o para consultar conjunto de par√¢metros do modelo Rainfall Runoff Routing, dados:
    bac [int] = n√∫mero da sub-bacia no SISPSHI;
    ano [int] = ano da calibra√ß√£o;
    cmb [str] = nome do tipo de chuva m√©dia (s√≥ utiliza se ano == 2013);
    numero [int] = n√∫mero do conjunto de par√¢metros (s√≥ utiliza se ano == 2013)."""
    
    # Testando consist√™ncia dos par√¢metros de entrada
    if bac not in PARAM2:
        raise KeyError('\n     '+repr(bac)+' n√£o √© um n√∫mero de bacia v√°lido.\n')
    if ano not in PARAM2[bac]:
        raise KeyError('\n     '+repr(ano)+' para bacia '+repr(bac)+' n√£o √© um ano da calibra√ß√£o v√°lido.\n')


    if ano == 2013:
        return PARAM2[bac][ano][cmb][numero]
    else:
        return PARAM2[bac][ano]


